
        export const PAGE_SIZE = 20;

        export interface Post {
            filename: string;
            slug: string;
            title: string;
            description: string;
            image: string;
            content: string;
            attributes: {
                created: string;
            } & Partial<{
                updated: string;
                tags: string[];
                related: string[];
                inbound: string[];
                author: string;
                // display settings
                imagePosition: 'top' | 'bottom';
                imagePadded: 'true' | 'false';
                className: string;
                variant: string;
                unlisted: 'true' | 'false';
                sidebar: 'show' | 'hide' | undefined;
            }>
        }

        export type Posts = Record<string, Post>;

        export const faviconUrls = {"docs.uniswap.org/contracts/universal-router/overview":"data:image/png;base64,","greenfield.xyz/":"data:image/png;base64,","claude.ai":"data:image/x-icon;base64,","x.com/karpathy/status/1886192184808149383":"data:image/x-icon;base64,","www.onplug.io":"data:image/vnd.microsoft.icon;base64,","twitter.com/nftchance":"data:image/x-icon;base64,","twitter.com/drakedanner":"data:image/x-icon;base64,","www.cursor.com/":"data:image/png;base64,","morpho.org/":"data:image/x-icon;base64,","onplug.io":"data:image/vnd.microsoft.icon;base64,","chance.utc24.io/paper/glass-box/":"data:image/x-icon;base64,"} as const;

        export const posts: Posts = {oneinterface:{filename:"one-interface",slug:"one-interface",title:"DeFi Command Centers.",description:"One interface to interact with Ethereum....",image:"/cdn/papers/hello-world.png",content:"\n\nEvery significant advancement in technology has been marked by the emergence of sophisticated tools that serve its most dedicated users. Traditional finance has its Bloomberg Terminal. Software developers have Visual Studio Code and its forks. These aren't just interfaces - they're command centers where information and control converge with precision. DeFi deserves the same level of sophistication and control. We're here to put a serious battle station in your hands.\n\n## The Current Reality\n\nIf you're reading this, your setup probably looks familiar: multiple monitors streaming real-time data, Telegram notifications cascading in the background, and browser tabs multiplying faster than your holdings. You've mastered the art of context-switching between protocols, manually orchestrating executions, and tracking positions across an increasingly fragmented landscape. This isn't sustainable. Not because we \"need to touch grass\" or because \"the brainrot goes too deep\" - but because we need better tools.\n\nThe data confirms what we already know from experience. Onchain research from [Greenfield Capital](https://greenfield.xyz/) shows that a critical 25% of sessions involve users executing 2-10 transactions in sequence. These multi-transaction sessions account for a staggering 45% of all onchain activity.\n\nThink about that. Almost half of all onchain transactions occur when users are executing multi-step workflows, jumping between different protocol interfaces, and manually orchestrating complex actions. That's not just inefficient—it's a massive opportunity cost for everyone except the MEV bots feasting on your predictable transaction patterns.\n\n## The Everything Aggregator\n\nWe built Plug to be the command center that DeFi has been missing. This isn't another aggregator - it's a professional-grade interface that brings true protocol composition and strategy execution to your fingertips.\n\nWith Plug, you gain:\n\n- Deep Protocol Integration: Combine the full capabilities of major protocols without compromise\n- Constraint-Driven Execution: Set precise conditions for your transactions to execute automatically\n- Custom Workspaces: Arrange critical information and controls exactly where you need them\n- Strategy Composition: Deploy complex multi-protocol strategies with professional-grade tools\n\nPlug offers a never before seen user experience for DeFi power users through its intent creation interface and generalized solver system. While some modern protocols such as [Morpho](https://morpho.org/) and Uniswap's [UniversalRouter](https://docs.uniswap.org/contracts/universal-router/overview) offer their own bundlers and routers, most protocols don't offer this capability at all. Beyond general bundle preparation, however, Plug is the first product to offer true cross-protocol constraint-driven onchain bundles.\n\nWith Plug, you can finally compose transactions across any integrated protocol, setting precise execution parameters that respect your strategy requirements. All without requiring you to babysit your position or execute each step manually. This isn't just convenience - it's the difference between capturing opportunities and missing them entirely.\n\n## Beyond Basic Aggregation\n\nWe're not here to simplify DeFi by reducing its capabilities. We're here to make its full power accessible through an interface worthy of how you operate.\n\nImagine:\n\n- Monitoring complex positions across protocols with institutional-grade precision\n- Deploying automated strategies that execute exactly as intended, even while you sleep\n- Creating custom views that adapt to different market conditions and strategies\n- Composing protocols in ways that unlock entirely new possibilities\n\nThe interface itself is designed for information density without overwhelming you. Key metrics are customizable and positioned exactly where you need them. Critical controls are always accessible. The days of searching through bookmarks for that one protocol interface you need are over - everything is integrated into a cohesive command center that lives right at your fingertips.\n\nGreenfield's research found that users cited two major barriers to adopting automation tools: trust and complexity. Plug addresses both head-on. You're not ceding control to a black box—you're defining precise constraints for execution within a what we like to call a [Glass Box](https://chance.utc24.io/paper/glass-box/). While the power under the hood is sophisticated, the interface is designed for DeFi practitioners who value clarity and control.\n\nThis makes sense when you consider that 84% of users surveyed don't use any automation tools today, despite spending significant time executing multi-step transactions. The market is primed for an interface that doesn't compromise on control while eliminating the inefficiencies of manual execution.\n\nGreenfield's data also shows that the most active 5% of users are executing bundles of more than 10 transactions in sequence, suggesting use of proprietary infrastructure. These power users have built their own solutions out of necessity and are getting outsized return from their custom tooling. Plug brings these capabilities to everyone who wants to operate at a high level without requiring maintaintaince custom code or infrastructure.\n\nThis is Plug - where professional capabilities meet relentless innovation.\n\n## The Future of DeFi\n\nWe build for the traders who track their positions in their sleep. For the yield farmers who optimize their strategies down to the gwei. For everyone who sees DeFi not just as a market, but as an arena where technical excellence meets strategic mastery. This isn't about making DeFi easier - it's about making it more powerful. About giving you the tools to execute your vision with the precision it deserves.\n\nWhat we're building goes beyond convenience. This is about setting a new standard for how we interact with DeFi. Where professional-grade capabilities aren't just accessible - they're expected. Where the interface itself becomes an advantage rather than an obstacle.\n\nReady to take control? Join the waitlist at [onplug.io](https://onplug.io).\n",attributes:{created:"2025-03-03T05:00:00.000Z",className:"",tags:["perspective"],author:"drakedanner"}},chatinterfaces:{filename:"chat-interfaces",slug:"chat-interfaces",title:"Chat Interfaces and Crypto Agents.",description:"Building the infrastructure required to enable agents to make onchain transactions....",image:"/cdn/papers/hello-world.png",content:"\n\nEvery morning, I wake up and start working with a symphony of AI assistants. Claude helps architect our systems, Cursor generates our code, ChatGPT brainstorms solutions, Perplexity researches edge cases, the list goes on. My reality is highly AI-augmented.\nSo when someone sends me yet another crypto agent chat interface, I get why they're excited. The promise is intoxicating...\n\"What if you could just tell an AI to make you money?\"\nJust tell an AI what you want, and it handles all the complexity of crypto for you. No more juggling DEX interfaces, tracking yield farms, or monitoring positions across chains. Just vibes and gains.\nBut I'm frustrated because no one has shown me an agent that can do something other than swap or bridge. No one has shown me a chat interface for transaction definition that actually works. Right now, we're swimming in demos and pitch decks while hard problems remain unsolved.\nAlthough it's early, there's an exciting future for these proof of concept ideas. Many societal markers point towards a future with systems that transact on behalf of humans using crypto: users believe in this future, investors believe in this future enough to fund it, builders are attempting to create this future, etc.\n\nLast week we budgeted a few hours to explore what a chat interface for Plug might look like. It is scrappy, but it's better than every single market-available \"agent\" that exists today.\nMorgan can read your wallet contents, build and discover Plugs to use, suggest actions based on your goals, run and schedule your Plugs, re-organize the app with a live context-based layout, etc. It only took a ~300 lines of code to significantly improve upon the experience that is readily available today.\n![An example of Plug's chat interface in action](https://cdn.onplug.io/posts/chat-interfaces/1-morgan.png)\nIf you want to try Morgan out someday, sign up for the [Plug waitlist](https://onplug.io).\nAfter testing other crypto AI agents and exploring the chat interface in our product, I've come to a realization: we're asking the wrong questions about what AI should do in crypto.\n\n## Current State of Crypto AI Agents\n\nThe gap between promise and reality becomes clear when we examine actual implementations. Let's look at some leading attempts at crypto AI agents to understand what their successes and limitations reveal about our current approach to AI in crypto.\n\n### Nani.ooo\n\nNani was one of the first intent agents that I came across midway through 2024 and became the first “agent” project I tried out. When I first tried nani.ooo, it was a Windows Desktop-esque experience with different apps I could click into, one of which was the chat interface. After depositing ETH, I was able to use the chat interface to swap to NEETH (their own token).\n\nWhen I try to use the interface today, the experience is more similar to ChatGPT and it does seem to try to write an intent and post it to the Nani Deployer contract.\n\n![Nani.ooo interface writing an intent using an LLM chat interface](https://cdn.onplug.io/posts/chat-interfaces/2-nani.png)\nWhen I click EXECUTE ON SMART WALLET, I get error messages that don’t allow me to move forward. I see that there are some other commands written to the contract on Basescan.\n![Basescan interface showing transactions to the Nani Deployer contract](https://cdn.onplug.io/posts/chat-interfaces/3-basescan.png)\nMy experience ended here. My understanding is that in it's current state, Nani is more of a set of developer tools than a consumer product.\n\n### Griffain\n\nAfter trading the $GRIFFAIN AI memecoin, I finally was able to try out the platform. I had to spend 2 SOL to get access and then ended up in an interface with a bunch of different “agents” available to me.\n![Griffain agent marketplace](https://cdn.onplug.io/posts/chat-interfaces/4-griffain.png)\nI chose to interact with the Sniper Bot and did not have the best experience. I was expecting to have a back and forth with the agent about what we’d be doing together but instead it felt like I kicked off an open script to buy memecoins based on parameters loosely defined in my sentence: Only snipe if the description mentions AI.\n![Griffain sniper bot](https://cdn.onplug.io/posts/chat-interfaces/5-griffain.png)\nWhen we think about generalized intents, should the AI help you devise the intent or should the AI write the intent for you? At which point do you give over the wheel and say send it?\n\n## The Chat Interface Oversimplification\n\nUsing a chat interface to write financial transaction instructions isn't just inefficient - it's technological regression. We've moved from command line interfaces to graphical UIs because they're more efficient, only to circle back to essentially typing commands in natural language? It's like replacing your banking app with a local bank branch.\nThe promise of AI isn't in making simple tasks more complicated - it's in making complex tasks more approachable. Yet current crypto chat interfaces often add unnecessary steps to straightforward operations while failing to meaningfully handle complex ones.\n\n## The Intent Behind AI Agent Usage\n\nMy user experience with these products has led me to wonder what users truly want out of chat interfaces and AI agent interactions?\nUsing LLMs in our worfklows adds value because we can…\n\n- Offload decision making and responsibility\n- Abstract complexity\n- Be met where we are informationally\n- Interact with a personality that guides and entertains us\n  Interacting with software through an anthropomorphized chat interface isn’t a wholly new concept but it’s one that has been highly re-popularized since the release of ChatGPT in late 2022\\.\n  Early story based video games could be interacted with through a chat interface that allowed players to type commands to move through the story.\n  While software products with buttons communicate where the boundaries are, chat interfaces allow you to think anything is possible… even if it isn’t. The blackbox aspects of LLM chatbots lead to a sense of wonder – one of the few pieces of consumer technology that still feels magical to us today.\n  But as Chance mentions in [The Glass Box](https://chance.utc24.io/paper/glass-box/):\n\n> _These models optimize for scale, minimizing the cognitive load on users. The complexity is hidden to provide an interface that \"just works.\" But here lies the flaw: the more hidden the system, the more prone it becomes to misuse, misunderstanding, and distrust. It introduces fragility where transparency could build resilience._\n> By trading an aspect of our autonomy for convenience and wonder when offloading decision making to opaque LLMs, we introduce room for influence and error.\n\n## Real Utility in AI Crypto Agents\n\nIn many cases, trading off nuance control to an LLM for speed in output is net positive. Earlier this month, [Andrej Karpathy](https://x.com/karpathy/status/1886192184808149383) beautifully articulated a feeling that a lot of people have been feeling recently – a type of working flow state wherein you code via prompts.\n![Andrej Karpathy vibe coding tweet](https://cdn.onplug.io/posts/chat-interfaces/8-vibecoding.png)\n\n> _There's a new kind of coding I call \"vibe coding\", where you fully give in to the vibes, embrace exponentials, and forget that the code even exists. It's possible because the LLMs (e.g. Cursor Composer w Sonnet) are getting too good. Also I just talk to Composer with SuperWhisper so I barely even touch the keyboard. I ask for the dumbest things like \"decrease the padding on the sidebar by half\" because I'm too lazy to find it. I \"Accept All\" always, I don't read the diffs anymore. When I get error messages I just copy paste them in with no comment, usually that fixes it. The code grows beyond my usual comprehension, I'd have to really read through it for a while. Sometimes the LLMs can't fix a bug so I just work around it or ask for random changes until it goes away. It's not too bad for throwaway weekend projects, but still quite amusing. I'm building a project or webapp, but it's not really coding \\- I just see stuff, say stuff, run stuff, and copy paste stuff, and it mostly works._\n> When I use [Cursor](https://www.cursor.com/) and [Claude](https://claude.ai), I sometimes reach this flow state and push features faster than expected. At other times, I find myself in a deadend and have to dump active changes and restart at the most recent working commit.\n\nVibe coding works in software developments thanks to the ability to revert changes. It's a different story for onchain transactions.\n\nDo you really want to vibe code your financial activities?\n\nYou could get away with vibe coding a single trading wallet – this is essentially what I did with Griffain. I said, “Hey I’m feeling frisky today let’s buy some memecoins that fit my parameters” and lil buddy gave me exactly what I wanted.\n\n![Griffain Sniper Bot](https://cdn.onplug.io/posts/chat-interfaces/9-griffain.png)\n\nThe Griffain Sniper Bot I used started buying things quickly and I didn’t have time to respond before it chewed through my deposits; a risk of automation (especially in the context of pseudo-gambling memecoins).\nMy experience using AI in development shows how AI can be a powerful thought partner when building complex systems. What if we applied this same collaborative framework to crypto? Instead of asking AI to autonomously manage our assets, what if we used it to help us make better decisions about them?\nA different model emerges \\- one of purposeful collaboration rather than autonomous execution. This suggests a more nuanced approach to AI agents in crypto.\n\n## Building Infrastructure for Agents\n\nRight now, most crypto AI interfaces can swap and bridge because that's all their underlying infrastructure allows. The multi-function agentic future we envision requires more work to achieve.\nThis is precisely why we're building Plug the way we are. We're not starting with a chat interface or a single omniscient agent – we're building the foundational infrastructure that enables meaningful agent collaboration. A robust solver that can compose complex transactions across protocols. A growing library of protocol integrations. A framework for writing and executing generalized intents.\n\nWhen we integrate a protocol into Plug, we're expanding the universe of what's possible for every agent in the ecosystem. Each integration creates new possibilities for composition and automation. We're starting from first principles, focusing on the fundamentals that will empower both humans and agents to do more with crypto.\n",attributes:{created:"2025-02-17T05:00:00.000Z",className:"",tags:["perspective"],author:"drakedanner"}},helloworld:{filename:"say-hello",slug:"hello-world",title:"Hello World.",description:"Command centers for the future built by the terminally online....",image:"/cdn/papers/hello-world.png",content:"\n\nWe are Terminally Online Inc. and you may know us individually as [danner](https://twitter.com/drakedanner) or [chance](https://twitter.com/nftchance). We've spent the past 5 years plugged into the EVM landscape and we're here to plug you in too.\n\n## The Reality Check\n\nIf you're reading this, you probably have a setup that looks familiar: Multiple monitors, endless Discord and Telegra notifications, and more browser windows than your RAM signed up for. The state of DeFi feels like trying to play 4D chess while juggling. You've got yield farms here, LP positions there, and god forbid you try to time a transaction across multiple protocols without missing the perfect entry.\n\nWe've been there. We are there. And we're building the solution we've always wanted. Initially, when we set out to build Plug, we considered building a product that allowed users to log off and spend more time touching grass. As we continued to build, we realized - that's not who we are; that's not who you are.\n\nLet's be real - I've got 47 browser tabs open right now. This isn't just a problem to solve - it's who we are. The question isn't how to log off, it's how to become even more online. We live in the ether, we spend our days streaming our homes to those we build with. We named our company Terminally Online for a reason. We don't log off and we are here to build for others like us.\n\n## Our Journey Here\n\nI've spent my entire life seeking the cutting edge of functional technology and my entire career in early stage fintech and crypto startups. I've had the opportunity to build teams and hire across every department imaginable. I've gotten to perform a laundry list of operational and technical roles and the teams I've worked with have built systems that have processed $5b+ across compliant Web2 and Web3 rails. I've gotten to work with Chance over the years as he's enabled nearly a million gas optimized transactions and developed delightful software experiences.\nWe're excited to begin releasing product that we fully own and direct.\n\n## Meet Plug\n\nWe're not here to tell you to touch grass. We're here to build the command center for the terminally online. Your protocols, your strategies, your automations - all running exactly how you want them, when you want them. No more tab juggling required.\nFor the first time ever, you can:\n\n- Schedule constraints-driven transactions (because sometimes you need to sleep)\n- Access all major protocol functionality without bouncing between apps\n- Create and share strategies that actually make you money\n- Set up \"if this, then that\" executions that squeeze maximum value from every move\n  One interface to access Etherem, one interface to combine protocols, one interface to schedule transactions, and one interface to manage your onchain experience.\n\n## What's Coming\n\nWe're starting with Season 0 - our founding users phase. This initial release will be referral-gated, with priority access for everyone on the Plug waitlist. Being a founding user means more than just early access; it comes with built-in advantages that persist:\n\nYour transactions will be evaluated more frequently, leading to better execution. We'll subsidize your gas costs on L2s, and you'll get early access to new features as we roll them out.\n\nWe're taking a seasonal approach to give us flexibility - each season lasting between one to several months. This structure lets us integrate new protocols, test incentive alignment mechanisms, and evolve the product ecosystem based on what we learn together.\n\nWhen we transition to Season 1, our founding users keep their enhanced capabilities. We're building Plug for the long term, and we want our earliest users to remain at the forefront of its evolution.\n\n## The Future\n\nThis isn't just another DeFi tool. We're building the infrastructure for the next generation of onchain activity. A platform where users can compose, automate, and execute complex strategies without compromising on control or capability. This is about unlocking the true potential of being terminally online.\n\nReady to plug in? Join the waitlist at [onplug.io](https://www.onplug.io).\n",attributes:{created:"2025-01-28T05:00:00.000Z",className:"",tags:["perspective"],author:"drakedanner"}}};

        // * Get all the Posts for a given page.
        export const getPosts = (
            page = 1,
            pageSize = PAGE_SIZE,
            filter?:
                | Partial<Record<'date' | 'tag' | 'search', Partial<string>>>
                | undefined
        ): {
            posts: Post[]
            count: number
            hasNext: boolean
            random: Post
        } => {
            // ! Filter the posts before paginating so that we can get a final count.
            const filteredPosts = Object.values(
                Object.values(posts ?? {}).reduce<Record<string, Post>>(
                    (acc, article) => {
                        if(article.attributes.unlisted) return acc

                        if (!filter) {
                            acc[article.slug] = article

                            return acc
                        }

                        const { tag, date, search } = filter

                        // * Check the lowercase tags against the lowercase tag parameter.
                        const matchesTag =
                            !tag ||
                            (article.attributes.tags?.some(
                                articleTag =>
                                    articleTag.toLowerCase() === tag.toLowerCase()
                            ) ??
                                false)

                        // ! Require the exact date match.
                        const matchesDate =
                            !date ||
                            ((article.attributes.created?.includes(date) ||
                                article.attributes.updated?.includes(date)) ??
                                false)

                        const matchesSearch =
                            !search ||
                            article.title
                                ?.toLowerCase()
                                .includes(search.toLowerCase()) ||
                            article.description
                                ?.toLowerCase()
                                .includes(search.toLowerCase()) ||
                            article.content
                                ?.toLowerCase()
                                .includes(search.toLowerCase()) ||
                            (article.attributes.tags?.some(articleTag =>
                                articleTag.toLowerCase().includes(search.toLowerCase())
                            ) ??
                                false)

                        if (matchesTag && matchesDate && matchesSearch) {
                            acc[article.slug] = article
                        }

                        return acc
                    },
                    {}
                )
            )

            const count = filteredPosts.length
            const keys = Object.keys(posts)

            return {
                posts: filteredPosts.slice(
                    (page - 1) * pageSize,
                    page * pageSize
                ),
                count,
                hasNext: count > page * pageSize,
                random: posts[keys[Math.floor(Math.random() * keys.length)]]
            }
        }

        // * Get a specific Post by the value of the slug parameter in each Post.
        // ! The parameter can be the dictionary key or the slug which is a slug on the Post.
        export type PostLookupKey = keyof typeof posts
        export type PostLookup = (typeof posts)[PostLookupKey]['slug']

        export const getPost = (lookup: PostLookup) => {
            const article = posts[lookup.replaceAll('-', '') as PostLookupKey]

            if (!article) throw new Error('Post not found')

            return article
        }

        // * Get the favicon for a given URL.
        export const getFavicon = (url?: string) => {
            if (!url) return null

            const faviconUrl =
                faviconUrls[
                    url
                        .replace('https://', '')
                        .replace('http://', '') as keyof typeof faviconUrls
                ]

            if (!faviconUrl) return null

            return faviconUrl
        }
        